        DB::unprepared("
         
        INSERT INTO `shipment_milestones` (`id`, `created_at`, `updated_at`, `name`, `instructions`, `general_information`) VALUES
(1, '2022-01-12 14:32:23', '2022-03-31 16:58:26', 'arrival_notice', 'USA Office TO:    -Take Firms from Carrier Arrival Notice, input in Termial Feild on the Arrival Notice Tab, and click send\r\n                                    **If there is No arrival notice yet, use the Firms from the Status Tab. \r\n                                    **If it is not there, Track and Trace to find the Firms Code\r\n                                    **If it is not there, Make sure you are taking the steps to get what you need', 'What is it?                     The Arrival Notice we send is a notice of arrival to the customer  (though It includes more than just the arrival time)\r\nImportance:                   This is where we will have a majority of our communications with the customer. \r\n                                        It\'s where we answer questions, notify about changes and ask for things. \r\n                                        We must be careful what we write here - as with any time we interact with the customer.'),
(3, '2022-01-12 14:38:06', '2022-03-31 17:39:42', 'customs_sent', 'USA Office TO:          -Understand exactly what is needed (Per each supplier)\r\n                                                    - HBL \r\n                                                    - Commercial Invoice     --> Tells the value of a shipment\r\n                                                    - Packing List                  --> Tells what is in the shipment\r\n                                    -Check that HBL document is there - 99% it is\r\n                                          **if not there, ask shia - there might be a reason why \r\n                                    -Check for Commercial Docs Needed (Look In the BL Tab & In the Customs Tab)\r\n                                          **if they are not there, check the requirements for who to ask\r\n                                                   - Overseas; Send \'Commercial Docs EMAIL\'\r\n                                                   - Customer: Ask on the Arrival Notice we sent to the customer for Docs\r\n                                                   - Supplier: Add them to AN - In most cases, we do not do this. \r\n                                   -Submit on the Customs Tab. (It will send an automatic email to our customs broker - Ocean freight Logistics)', 'What is it?                     The general process of customs is the process of informing the US government about what is being imported and its value.\r\n                                        We submit to our customs broker - who in turn - submits to the government.\r\n                                        Though to accomplish this milestone, you merely need to supply our customs broker with the necessary information \r\n                                         Namely - what is being imported and its value. (which is derived from the documents listed in the instructions)\r\n                                        This milestone is NOT about giving the Final Approval to submit to the government  \r\nImportance:                   Sending proper documentation to the CBP results in a Customs release which we need in order to pick up\r\n                                        Failure to do so can lead to delays in release or worse - a full-on Exam. \r\n\r\n --> Sometimes there is more than one supplier - in that case we need to submit the packing lists, invoices, and HBLs from each.'),
(4, '2022-01-12 14:41:04', '2022-03-31 16:02:10', 'arrival_notice_confirmed', 'USA Office TO:     -Check for AN by the MBL Number in your emails (To find the AN).\r\n                                       **if no AN:  \r\n                                           -check the carriers email via the mbl copy and request it from them  ( ‘AN Request EMAIL ) \r\n                                                ** If no MBL Copy, ask overseas ( ‘MBL Copy Request’ )\r\n                                                **If sent already yesterday, but no response- don’t respond yet.\r\n                               -Input Carrier ETA \r\n                               -Input Carrier Firms\r\n                               -Mark received & archive Arrival Notice Email', 'What is it?                     Confirming the receipt of Arrival Notice and Double Checking Information.\r\nImportance:                   Arrival Notices have information that is crucial to the success of processing a shipment. (Firms, ETA, MBL, Containers, MBL Release, etc.. )\r\n                                        The information on it will indicate all sorts of things you need to do. ( A release, A payment, or notification to customer/Trucker, etc..)\r\n                                        Therefore - we specifically input certain information so as not to missing crucial indicators that will cause issues if not addressed. \r\n                                        Although we only input the ETA & Firms. Those are not the only things that we need to care about. \r\nWhere can I find it?      You can usually find this in your emails (Searching by MBL) forwarded to you from the shifl arrival notices inbox. Sometimes you have to ask for it in order for it to come. \r\n                    \r\n--> If a shipment is urgent, you will process the arrival notice right away as opposed to waiting until the next time you go through your shipments in the Shifl system**\r\n--> When getting to this step - if you see you haven\'t gotten your arrival notice yet - you need to be making sure that you get it. You can\'t just sit around and wait.  \r\n       We need to take all steps necessary in order to ensure it comes in on time - if that means calling, emailing, reminding incessantly - then so be it. \r\n       That is the only way we can say to our customers that we did everything possible to ensure their shipments were processed in time.'),
(5, '2022-01-12 14:44:31', '2022-03-31 18:04:52', 'customs_processed', 'USA Office TO:          Final Approval (To submit to CBP)\r\n                                         -Check requirements to see who approves the 7501 \r\n                                                **if it doesn\'t say anything then the default is that the customer approves. \r\n                                                **If it says you approve\r\n                                                        -Make sure the Duty % matches what the requirements says\r\n                                                               **If it doesn\'t match confirm with the customer  \r\n                                                **If it says the customer\r\n                                                        -Ask the customer to approve the 7501\r\n                                       -Confirm whether Approval was given (whether by you or the customer)\r\n                                       -Check if we care about telex in the requirements\r\n                                             **If not, you can disregard the HBL Telex requirement in the next line.\r\n                                       -Give the Final Approval to customs ONLY when HBL Telex is good to go.\r\n  \r\n for HBL          **If not released, notify Customer – check requirements for how (most customers don’t have instruction on this)\r\n HBL release is customer paying their supplier - cant get their good until done.', 'What is it?                     The general process of customs is the process of informing the US government about what is being imported and its value.\r\n                                        We submit to our customs broker - who in turn - submits to the government.\r\n                                        Though to accomplish this milestone,  You need to finish what you started.   \r\n                                         This milestone is about getting the approvals needed on the documents created before submitting them. \r\n              \r\nImportance:                   Sending proper documentation to the CBP results in a Customs release which we need in order to pick up\r\n                                        Failure to do so can lead to delays in release or worse - a full-on Exam. \r\n                                        Additionally, this milestone takes into account HBL Telex release  - which is extremely important to take note of. \r\n\r\n--> Understand what is happening in this milestone and what HBL Telex release has to do.  \r\n      As I\'m sure you know, we cannot give a shipment to the customer without an HBL Release. (We must hold the shipment until is is released)\r\n      When making the payment to fulfill the ‘Freight Release Processed’ Milestone, we always look to see whether we handle customs. \r\n      If we do, we push off the worry about HBL Telex Release to the Customs Processed Milestone - which is now.\r\n      By ensuring that we will still hold the shipment - Just at Customs instead of Freight- we go ahead with the payment.\r\n      Rest assured that we are effectively stopping the importer from receiving goods that are not yet paid for \r\n\r\n     Thus, customs final approval, - a fairly simple process has become sort of a checkpoint for HBL Telex Release. \r\n      If we don’t have HBL Telex, we will still take care of customs up to the last point of submitting. \r\n      But only once we have the release - will we allow the final step to go through. \r\n\r\n     The reason it is preferable for to us to hold here, rather than by the payment is that, \r\n     While the release of customs can take an hour or two, the release by payment takes at least 24 hours if not more. \r\n     Holding here - means the second we get the release we will already be having the shipment released shortly. \r\n     If we hold by freight - that will not be the case.'),
(6, '2022-01-12 14:49:58', '2022-04-01 05:54:04', 'freight_released_processed', 'USA Office TO:           Step One:   Putting in Bills/Putting in Invoices\r\n                                     Step Two:   Making Freight Payment(s) \r\n\r\n_______________FCL (FULL Container Load)______________   ______________LCL (LESS Container Load)___________________    \r\nPutting in Bills                                                                                  Putting in Bills\r\n     -Add Bill (Customs: Ocean freight logistics)                                   -Add LCL to the Shifl Ref Number\r\n          **If we don’t handle customs – delete the bill                           -Add Bill (Customs: Ocean freight logistics) \r\n     -Add Bill(Freight: Debit Note, AN, or both)                                             **If we don’t handle customs – delete the bill         \r\n        **If we don’t handle freight - find out who will pay                    -Add Bill( Debit Note, AN, or both) \r\n          -Check for AN by MBLin emails…                                                        **If we don’t handle freight - find out who will pay\r\n          -Check for freight Debit Note on bl tab                                             -Check for AN by MBLin emails… \r\n          -Identify who we need to pay and input the Info                             -Check Debit Note section on BL Tab  \r\n          -Check bl tab for COST mismatch                                                      -Identify who we need to pay and input the info    \r\n               **If no cost in bl tab check the notes                                            -Check bl tab for COST mismatch    \r\n                 **If mismatch, send issue EMAIL & write in notes.                         **If no cost in bl tab check the notes   \r\n     - Add Bill(s) - possibly!                                                                                      **If mismatch, send issue EMAIL & write in notes.  \r\n          -Check for non-freight Debit Notes                                              - Add Bill(s) - possibly!           \r\n               **if we have - input bill correctly                                                   -Check for non-freight Debit Notes          \r\n          -Check if we handle Trucking                                                                   **if we have - input bill correctly       \r\n              -Check/if LA then there\'s Pier Pass (Sheets)                 Putting in Invoices  -->  Upkeep the Balance!\r\n              -Check/if OAK then there\'s Gate Fee (Emodal)                      -Add Invoice\r\n              -Check/if Miami then there\'s Gate Fee (TOPS)                            -Add Freight Charge\r\n          -Double-check if it is a requirement to do PierPass                             **If we don\'t handle - Dont\r\n               **If so, follow pier pass instructions by location.                             **If missing SELLING rate \r\nPutting in Invoices  --> Upkeep the Balance!                                                      -Send SELLING issue EMAIL & write in notes.    \r\n        -Add Invoice                                                                                                    -Put Cost + $400 as the charge for now....\r\n            -Add Freight Charge                                                                        -Add Customs Charge  \r\n                **If we don\'t handle - Dont                                                               **If we don\'t handle - Dont\r\n                **If missing SELLING rate                                                           -Add Charge for Possible Bills that happened  \r\n                    -Send SELLING issue EMAIL & write in notes.                          -Ask someone for Markup rate  \r\n                    -Put Cost + $400 as the charge for now....                           -Add Warehousing Charge \r\n            -Add Customs Charge                                                                         **If missing SELLING rate \r\n                **If we don\'t handle - Dont                                                                -Send SELLING issue EMAIL & write in notes.    \r\n            -Add Charge for Possible Bills that happened                             -Check requirements for anything relevant \r\n                    -Ask someone for Markup rate  \r\n           -Check requirements for anything relevant\r\n     -Send Invoice - BUT FIRST!!!   \r\n         -Check Notes for any ISSUEs\r\n         -Check Notes if requirements say not to send \r\n_____________________________________________________   _________________________________________________________ \r\n------------------------------------------------------------------------------------------------------------------------------------\r\nMaking Freight Payment(s)\r\n   -Check requirements to see if we handle customs. \r\n       **If we DONT handle Customs \r\n                 -Check if HBL Telex is released \r\n                    **If it isn’t you MUST hold the shipment from getting released by not pressing the Pay Button.\r\n                        Make sure you are following up with the people that can get HBL released - You cannot just wait for it to show\r\n                        You need to actively pursue getting the HBL. \r\n                    **If it Is - Continue on with the steps\r\n       **If we DO handle Customs \r\n                -Continue with the steps\r\n   -Press Pay button \r\n   -Write in the notes of the system the date you pressed the Pay Button (PB00/00)\r\n   -Bring the Email confirmation from Accounting to the Arrival Notice from the carrier \r\n   -Fill in the Milestone once all above is done.', 'COMING.... whats written here is in progress\r\nThis milestone consists of the process necessary in ensuring the shipping company releases the cargo. \r\nHow To Input and pay Pier Pass -create pier pass bill, Container as bill#\r\n                                                  -cost acc to size, charge customer +$35/or what the requirements say\r\n                                                        40HC-68.42 / 20-34.21\r\nHow to input customs bill & invoice\r\nHow to input Freight bill & invoice\r\nHow LCL\'s Billings work... \r\nUpkeep the Balance! every bill must have a corresponding charge with the right markup on the invoicing side of things. The bills are what we pay and the invoices are what people pay us . if we dont properly balance we will not be making a profit.'),
(7, '2022-01-12 15:09:06', '2022-01-12 15:12:17', 'delivery_order_left', 'Receiving Teams Notes:\n-check requirements for location, trucker, whether copy customer & then send.', NULL),
(8, '2022-01-12 15:09:30', '2022-04-01 06:04:13', 'DO_confirmed', 'USA Office TO:           -If Trucker confirms update the Delivery Order Confirmed status\r\n                                          **if sent yesterday and no response yet, follow up.', 'What is it?                     It is the confirmation from the Trucker that he received our Delivery Order and he accepts responcibility to pick it up on time. \r\nImportance:                   Confirming DO Acceptance ensures we won’t become responsible for a container that wasn’t picked up by mistake.'),
(9, '2022-01-12 15:11:17', '2022-04-01 06:13:03', 'freight_confirmed', 'USA Office TO:          -check port site for releases and holds\r\n                                           **if there is a special case, like an EXAM or an LCL - add it to the ref and keep an eye on it.', 'What is it?                     This is the final confirmation that everything we worked for yielded the proper results. \r\n                                        We check on the port of arrival’s website and see how our releases are doing. \r\nImportance:                   We need to know if there are any holds or unexpected issues as well as delayed releases so we can fix it asap. \r\n                                        We check the releases right after it arrives - so you need to realize - at this point - everything is urgent. \r\n                                        You reaction must be fast but also accurate - make sure you have help if you are unsure what to do.'),
(10, '2022-01-12 15:11:58', '2022-04-01 06:13:05', 'customs_released', 'USA Office TO:          -check port site for releases and holds\r\n                                           **if there is a special case, like an EXAM or an LCL - add it to the ref and keep an eye on it.', 'What is it?                     This is the final confirmation that everything we worked for yielded the proper results. \r\n                                        We check on the port of arrival’s website and see how our releases are doing. \r\nImportance:                   We need to know if there are any holds or unexpected issues as well as delayed releases so we can fix it asap. \r\n                                        We check the releases right after it arrives - so you need to realize - at this point - everything is urgent. \r\n                                        You reaction must be fast but also accurate - make sure you have help if you are unsure what to do.'),
(11, '2022-01-12 15:13:05', '2022-01-12 15:13:05', 'pending_refund', '-we check this once a week.', NULL),
(12, '2022-01-12 15:13:55', '2022-04-01 06:21:01', 'delivered', 'USA Office TO:          -If we do trucking, monitor trucking \r\n                                            **If we don\'t handle trucking, check if it is customs and freight released. \r\n                                                 **If it is - Marked completed.\r\n                                                 **If it isn\'t - You cannot mark it as delivered.', 'What is it?                This milestone is the calculated involvement of the account rep in handling Trucking   \r\n                                   The amount of involvement needed will greatly depend on the customer in question.  \r\n                                   If it is a well-seasoned customer, there is usually little to do but monitor the correspondence between the customer and the trucker and step in when issues arise. \r\n                                   In contrast, a new customer has delivery details that need to be smoothed out\r\n                                   We may need to figure out what mode (Live/Drop) of delivery it will be, warehousing delivery requirements\r\n                                   This would need to be figured out before the shipments even come in & that is the purpose of this milestone\r\nImportance:               If you don\'t handle trucking in the right way - costs go up for the customer and the quality of the delivery goes down. \r\n                                   This can cause customers not to what to deliver with us.     \r\n\r\n --> Sometimes, we are responsible for sending a delivery order but aren’t responsible for the actual handling of trucking. \r\n        This means that we can fill the ‘delivered’ milestone regardless of whether the container was picked, up delivered, or returned to the port. \r\n        In a case like that, it is not our responsibility to make sure that the container was delivered.'),
(13, '2022-01-12 15:16:10', '2022-03-04 18:08:57', 'billed', 'USA Office TO:\r\n-check requirements for billing instructions or preset rates\r\n-check notes for ISSUE\r\n    **if issue, follow up and do not send out any invoices - except for duty - if not resolved. \r\n-check profit - make sure everything matches up. \r\n-send any invoices that weren\'t sent already', NULL),
(14, '2022-01-12 15:16:29', '2022-04-01 06:06:34', 'released_at_terminal', 'All Offices:      You are not responsible for this milestone.\r\n所有办事处 :    您不对这个里程碑负责。\r\nसभी कार्यालय :  आप इस मील के पत्थर के लिए जिम्मेदार नहीं हैं।', 'This is automatically updated - You can ignore this.'),
(15, '2022-01-12 18:49:57', '2022-03-31 16:48:34', 'rate_confirmed', 'Malaysia  Office FROM:       Isi peristiwa penting ini apabila Tempahan Disahkan. \r\n                                                Fill this milestone in when the Booking is Confirmed.\r\nUSA          Office TO:            Not responsible for this.', NULL),
(16, '2022-03-04 15:46:27', '2022-03-31 15:36:19', 'booking_confirmed', 'USA Office TO:              Responsible for ensuring that this is done. \r\n                                            **If this is not done - contact Office From. \r\nOffice FROM:                 Ensure that this milestone is taken care of \r\n办公室从:                        确保处理好这个里程碑\r\nPejabat DARI:                Pastikan peristiwa penting ini dijaga', 'What is it?                     It means that the customer has confirmed that they want to book with us. \r\n                                        The customer can accept a booking in two ways. via email - which you will see in the booking emails. or through our Portal.\r\n                                       \r\nImportance:                   Here is where the customer decides which services to take with Shifl (Freight... Customs...) \r\n                                       Though trucking services by the destination of arrival isn\'t always yet decided at this point.\r\n\r\n --> Sometimes Customers want us to handle just Customs (or Customs + Trucking) without Ocean Freight. \r\n        In a case like this, since there is no freight to be booked from country to country, it never reaches our Overseas Booking Team\r\n        At the time that the customer reaches out directly to us (US Team) for this service - there probably won\'t even be a shipment in the system for it.  \r\n        We would be responsible to make sure this shipment is entered into the system by notifying our US Office From Team (For now - that means Levan@shifl.com)'),
(17, '2022-03-04 15:47:18', '2022-03-31 16:28:55', 'so_released', 'USA Office TO:              Responsible for ensuring that this is done. \r\n                                            **If this is not done - contact Office From. \r\nOffice FROM:                 Ensure that this milestone is taken care of \r\n办公室从:                        确保处理好这个里程碑\r\nPejabat DARI:                Pastikan peristiwa penting ini dijaga', NULL),
(18, '2022-03-04 15:48:09', '2022-03-31 16:45:13', 'isf_done', 'Anywhere Office FROM:      Fill the milestone in when ISF is Filed\r\nUSA           Office FROM:      Fill the milestone in when ISF is Filed\r\n                                                    **Check if we are handling ONLY Customs \r\n                                                         If so - write ONLY CUSTOMS in the notes of the shipment & advise the customer to send the Arrival Notice as soon as they have it. \r\n                                                         Confirm with them whether we will be handling their laying out for their freight charges and add that to the Notes as well.\r\nUSA Office TO:                     Responsible for ensuring that this is done. \r\n                                                    **If this is not done - contact Office From.', 'What is it?                     ISF (Importer Security Filing -10+2) is a United States CBP (Customs and Border Protection) requirement for all ocean cargo imports.\r\n                                        It is a document that is sent to the CBP including many pieces of information regarding the shipment coming in;\r\n\r\n                                                  - Supplier or manufacturer name and address, Owner or seller name and address, Ship-to name and address, House bill,   - \r\n                                                  - Container stuffing location,  Master bill including SCAC (standard carrier alpha codes),  Consolidator name and address,   - \r\n                                                  - Importer of  record number or foreign trade zone  applicant identification number,  Consignee number, Country of Origin   - \r\n                                                  - Commodity Harmonized Tariff Schedule number (each product on the shipment),                \r\n                                                       \r\n                                        The United States uses the information included in the ISF to flag high-risk shipments that may pose a safety threat upon arrival. \r\nImportance:                   It must be delivered to CBP at least 24 hours before the vessel departs to the US.\r\n                                        Failure to comply with the CBP’s ISF regulations can result in massive fees, increased inspections, and ultimately a delayed shipment. \r\n                                        Additionally, If ISF filing is incorrect or incomplete, CBP may refuse to permit the importer to unload or take the merchandise.'),
(19, '2022-03-08 19:02:26', '2022-03-31 16:59:16', 'mbl_released_confirmed', 'USA Office TO:               Responsible for ensuring that this is done. \r\n                                            **If this is not done - contact Office From. \r\n                                         - Check if Both Arrival Notice and System shows release/surrendered\r\n                                            **If Arrival Notice shows not released and the system does - confirm with Carrier that released (using MBL Copy Released)\r\n                                            **If Arrival Notice shows released and the system doesn\'t\r\n                                               -Check whether the regular MBL Copy is stamped with a release \r\n                                                  **If it is -           Email Office From about uploading the Surrendered Document in the correct Place. \r\n                                                  **If it isn\'t -      MOBL EMAIL  to Office From\r\n\r\nOffice FROM:                 Ensure that this milestone is taken care of \r\n                                        Upload MBL Copy to correct spot. (If released, upload to \"MBL Copy Surrendered / Released\")\r\n办公室从:                        确保处理好这个里程碑\r\n                                        将 MBL 副本上传到正确的位置 (如果发布，上传到\"MBL Copy Surrendered / Released\")\r\nPejabat DARI:                Pastikan peristiwa penting ini dijaga\r\n                                        Muat naik Salinan MBL ke tempat yang betul. (Jika dikeluarkan, muat naik ke \"MBL Copy Surrendered / Released\")', 'What is it?                     In simple - it is confirming the release of the MBL (Master Bill of Lading) - which is a contract between us and the carrier \r\n                                        It needs to get released by the agent in order for the carrier to be able to legally release it to us. \r\nImportance:                   We’ll need to make sure that the MBL is confirmed well before the container comes in.\r\n                                        Freight will not get released unless this is done. \r\nWhere can I find it?      This is something that would show on our MBL Copy and many times the Arrival Notice. \r\n\r\n --> Sometimes an Arrival Notice will show as not surrendered but the system will show it is done.\r\n        This merely means that at the time the carrier sent the Arrival Notice, our shipment was still unable to be released but now it\'s all good. \r\n        In a case like that, it is advisable to confirm with the carrier (using the Released MBL Copy) on whether the release is good.\r\n        It is important to make sure you both are on the same page. \r\n\r\n -->Sometimes the Arrival Notice will show a release but our system might not - in that case - contact our overseas to update the system.'),
(20, '2022-03-31 16:47:54', '2022-03-31 16:47:54', 'ams_done', 'USA Office TO:              Responsible for ensuring that this is done. \r\n                                            **If this is not done - contact Office From. \r\nOffice FROM:                 Ensure that this milestone is taken care of \r\n办公室从:                        确保处理好这个里程碑\r\nPejabat DARI:                Pastikan peristiwa penting ini dijaga', NULL);

        
        ");

